%[text] # fise\_otf2d
%[text] Illustrate the 2D Fourier representation of luminance images.
%[text] The Fourier transform is complex-valued.  When the image is real, the complex values obey symmetry conditions, such that
%[text]{"align":"center"} $F(u,v) = F^\*(-u,-v)$
%[text] where \* is complex conjugate.  This implies the amplitudes at those two locations are the same.
%[text] Also, for image harmonics the mean value is positive, so there will also be a positive value at $(0,0)$.  This mean value is usually much larger than the amplitudes of the Fourier coefficients.  That is why we show the image using log10(coefficient amplitude).
%[text] ## ISETCam initialization
ieInit;
%%
%[text] ## Create a test image
%[text] Harmonics are very simple because they are 'points' in the transform domain.  So let's start with that.
params = harmonicP;    % Creates a struct of harmonic parameters
params.freq = 8;       % Cycles per image

params.row = 33; params.col = 33;  % Image size
scene = sceneCreate('harmonic',params);
scene = sceneSet(scene,'fov',1);   % Making it 1 deg is simple

% Spatial frequency support.
fx = sceneGet(scene,'f support x'); fullFx = [-1*fliplr(fx), fx];
fy = sceneGet(scene,'f support y'); fullFy = [-1*fliplr(fy), fy];

% Space support.
x = sceneGet(scene,'spatial support x','deg');
y = sceneGet(scene,'spatial support y','deg');

% sceneWindow(scene);
%%
%[text] ## Operate on luminance - for simplicity
%[text] One harmonic is vertical and then we create a different harmonic at 45 deg angle.
img = sceneGet(scene,'luminance');

% The 2D Fourier transform
imgF = fft2(img);

% We build up the figure
ieFigure; %[output:9af30f08]

tiledlayout(2,2) %[output:9af30f08]

nexttile %[output:9af30f08]
imagesc(x,y,img); axis image %[output:9af30f08]
xlabel('Position (deg)'); ylabel('Position (deg)'); %[output:9af30f08]

nexttile; %[output:9af30f08]
imagesc(fullFx,fullFy,abs(fftshift(imgF)));  %[output:9af30f08]
axis equal; axis image; colormap(gray); %[output:9af30f08]
set(gca, 'Color', 'k'); % Set background color to black %[output:9af30f08]
grid on; % Turn on the grid %[output:9af30f08]
ax = gca; % Get current axes
ax.GridColor = [0.7 0.7 0.7]; % Set grid color to dark gray %[output:9af30f08]
ax.GridLineStyle = '-'; % Set grid line style
ax.LineWidth = 3; % Set grid line thickness %[output:9af30f08]
xlabel('Frequency (cyc/deg)'); %[output:9af30f08]
ylabel('Frequency (cyc/deg)'); %[output:9af30f08]

% A different harmonic
params.ang = 45;
[scene,parms] = sceneCreate('harmonic',params);
scene = sceneSet(scene,'fov',1);
img = sceneGet(scene,'luminance');
imgF = fft2(img);

nexttile %[output:9af30f08]
imagesc(x,y,img); axis image;  %[output:9af30f08]
xlabel('Position (deg)'); ylabel('Position (deg)'); %[output:9af30f08]
nexttile; %[output:9af30f08]
imagesc(fullFx,fullFy,abs(fftshift(imgF)));  %[output:9af30f08]
axis equal; axis image; colormap(gray); %[output:9af30f08]
set(gca, 'Color', 'k'); % Set background color to black %[output:9af30f08]
grid on; % Turn on the grid %[output:9af30f08]
ax = gca; % Get current axes
ax.GridColor = [0.7 0.7 0.7]; % Set grid color to dark gray %[output:9af30f08]
ax.GridLineStyle = '-'; % Set grid line style
ax.LineWidth = 3; % Set grid line thickness %[output:9af30f08]
xlabel('Frequency (cyc/deg)'); %[output:9af30f08]
ylabel('Frequency (cyc/deg)'); %[output:9af30f08]

%{
% Write out the figure as a PNG.
theDir = fullfile(fiseRootPath,'chapters','images','optics','11-transform');
exportgraphics(gcf,fullfile(theDir,'otf2d.png')); %[output:9af30f08]
%}
%%
%[text] ## End

